"""
Given two strings ransomNote and magazine, return true if ransomNote can be constructed by using the letters from
 magazine and false otherwise.

Each letter in magazine can only be used once in ransomNote.
"""
from collections import Counter


def can_construct(ransom_note: str, magazine: str) -> bool:
    """
    :param ransom_note: 1 <= len(ransom_note) <= 1e5, with all lowercase English letter
    :param magazine: 1 <= len(magazine) <= 1e5, with all lowercase English letter
    :return: whether ransom_note can be constructed by using letters from magazine
    """
    magazine_counter = Counter(magazine)
    ransom_note_counter = Counter(ransom_note)
    return all(ransom_note_counter[c] <= magazine_counter[c] for c in ransom_note_counter)


